<script>
var isClose = "<?=$show_modalVocher?>"

$(window).load(function() {

    //$currnet_page = $('#page').data('view');


    if (isClose == '' && $('body#main').length > 0) {
        $('#modalVocher').modal('show')
    }


    $('#modalVocher').on('hidden.bs.modal', function(e) {
        setCLoseVocher()
    })

    $('#close-modalVocher').on('click', function() {
        setCLoseVocher()
    })

    function setCLoseVocher() {
        $.ajax({
            type: "post",
            url: site_url() + "ajax/setmodalVocher",
            data: {
                modalVocher: 1
            },

        })
    }
});
</script>